import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import './App.css';

// Importar SVG desde src
import DownIcon from './down.svg';

function Home() {
  return (
    <section className="hero">
      <h1>Bienvenidos a Fondos.com</h1>
      <p>Tu sitio de informaci√≥n y servicios financieros</p>
    </section>
  );
}

function App() {
  return (
    <Router>
      <div className="background-container">
        <header className="header">
          <div className="logo">fondos.com</div>
          <nav className="nav">
            <Link className="navItem" to="/">
              <DownIcon className="icon" alt="Home" /> Home
            </Link>
            <Link className="navItem" to="/corporativo">
              <DownIcon className="icon" alt="Corporativo" /> Corporativo
            </Link>
            <Link className="navItem" to="/documentos">
              <DownIcon className="icon" alt="Documentos" /> Documentos
            </Link>
            <Link className="navItem" to="/servicios">
              <DownIcon className="icon" alt="Servicios" /> Servicios
            </Link>
            <Link className="navItem" to="/control-social">
              <DownIcon className="icon" alt="Control Social" /> Control Social
            </Link>
            <Link className="navItem" to="/emprendedores">
              <DownIcon className="icon" alt="Emprendedores" /> Emprendedores
            </Link>
            <Link className="navItem" to="/contacto">
              <DownIcon className="icon" alt="Contacto" /> Contacto
            </Link>
            <Link className="navItem" to="/login">
              <DownIcon className="icon" alt="Login" /> Login
            </Link>
          </nav>
        </header>
        <Routes>
          <Route path="/" element={<Home />} />
          {/* Otras rutas */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
